import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu) and click it to open mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for the mobile menu overlay to appear
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot of the opened mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Extract visible links in the mobile menu
    const mobileMenuLinks = await page.$$eval(
      '#mobileMenuOverlay.show .mobile-menu a',
      links => links.map(link => link.textContent.trim()).filter(Boolean)
    );

    // Click the "Electronics" link in the mobile menu (first occurrence)
    const electronicsLink = await page.$('#mobileMenuOverlay.show .mobile-menu >> text=Electronics');
    if (electronicsLink) {
      await electronicsLink.click();
    }

    // Take screenshot after clicking "Electronics"
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_clicked.png'));

    // Close the mobile menu using the close button
    await page.waitForSelector('#mobileMenuOverlay.show .close-mobile-menu', { timeout: 5000 });
    await page.click('#mobileMenuOverlay.show .close-mobile-menu');

    // Wait for the mobile menu overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Take screenshot after closing the mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested opening, navigating, and closing the mobile menu. Verified links and navigation.",
      extractedData: {
        mobileMenuLinks
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
